(function () {
    // 取消vm debug
    (function(){}).constructor === Function;
    Function.prototype.constructor = function(){};

    'use strict';

    document.onreadystatechange = () => {
        if (document.readyState === 'interactive') {
            let appScript = Array.from(document.getElementsByTagName('script')).find(ele=>ele.src.indexOf("app")>0)
            appScript.type='text/plain'
            var newScript = document.createElement('script')
            newScript.type='text/javascript'
            appScript.parentNode.insertBefore(newScript, appScript)
            appScript.parentNode.removeChild(appScript)

            let appSrc = appScript.src
            var xhr = new XMLHttpRequest();
            xhr.open('GET', appSrc, false);
            xhr.send();

            if (xhr.status === 200) {
                debugger
                let str = xhr.responseText
                newScript.text = str.replace("t.afterEach","")
            }

  }
};


})();